INSERT INTO `plugin_wiki_page` (`id`, `slug`, `title`, `is_public`, `worksheet`, `summary`, `body`, `tags`, `role`, `changelog`, `is_active`, `created_on`, `created_by`, `modified_on`, `modified_by`, `comments_allowed`) VALUES
(1, 'Index', 'Index', 'T', 'F', '', '<span style="font-weight:normal"><span style="font-weight:bold">Introduction</span><br><p>This project is to develop online learning tools to allow community members to upload language learning examples and teachers to use these resources with permission in schools and community teaching.<br></p><p>The material on Bundjalung-Yugambeh is from Margaret Sharpe''s work<br></p><p>Enjoy and contribute by contacting us to register</p><p>The maps of&nbsp;Bundjalung-Yugambeh&nbsp;  are under Maps on the menu<br></p><p><br></p></span>', '|1|', NULL, '', 'T', '2011-07-25 13:47:03', 1, '2013-04-27 22:05:44', 1, 'F'),
(18, 'map1', 'Map1', 'T', '0', '', '<div>Location of the Yugambeh-Bundjalung language  <br></div><img src="http://bundjalung.dalang.com.au/plugin_wiki/attachment/20">', '|3|', NULL, '', 'T', '2013-04-27 22:22:09', 1, '2014-08-01 15:36:39', 2, 'F'),
(20, 'map2', 'Map2', 'T', 'F', 'The Yugambeh-Bundjalung area ', 'The Yugambeh-Bundjalung\r\narea  <br><img src="http://Bundjalung.dalang.com.au/plugin_wiki/attachment/21">', '|3|', NULL, '', 'T', '2013-04-27 22:24:34', 1, '2014-08-02 08:36:58', 2, 'F'),
(24, 'map3', 'Map3', 'T', '0', 'Approximate dialect areas within Yugambeh-Bundjalung', '<p style="" text-align:center;text-align:center"="">Approximate dialect\r\nareas within Yugambeh-Bundjalung</p>\r\n<p style="" text-align:center;text-align:center"="">(older orthography\r\nfor Gidhabal)</p>  <img src="http://Bundjalung.dalang.com.au/plugin_wiki/attachment/22">', '|3|', NULL, '', 'T', '2013-04-27 22:26:30', 1, '2014-08-02 08:36:45', 2, 'F'),
(2, 'Bundjalung', 'Bundjalung', 'T', '0', '', '<p>The <strong>Bundjalung people</strong> (aka <em>Bunjalung</em>, <em>Badjalang</em>, <em>Bandjalang</em>) are the original custodians of northern coastal areas of New South Wales (Australia), an area that includes the Bundjalung National Park and Mount Warning (known to the Bundjalung people as <em>Wollumbin</em> (<em>"rainmaker"</em>).\r\n</p><p>\r\nBundjalung people all share in common descent from ancestors who once\r\n spoke as their first, preferred language, one or more of the dialect&nbsp;including:&nbsp;<span class="s1">Yugambeh,&nbsp;</span>Nganduwal,&nbsp;<span class="s1">Minyangbal&nbsp;(also referred to as Minjangbal)</span>, Njangbal, Biriin, Baryulgil,&nbsp;<span class="s1">Wahlubal</span>, Dinggabal, Wiyabal,&nbsp;<span class="s1">Gidabal or Gidhabal</span>, Galibal and&nbsp;<span class="s1">Wudjehbal</span>.</p>\r\n<p>More recently, following successful native title determinations, a \r\nfew descendants because of invested interests are formally questioning \r\nthe extent to which the ''Bundjalung'' are, or have ever been, a people or\r\n a nation </p><p>The Bundjalung language has been&nbsp;taught at various schools and in the community&nbsp;by dedicated community members.&nbsp;</p><p>Many resources were recorded and stored at AIATSIS and these are now being made available for the community to re-hear how the language was spoken.<br></p>', '|2|', NULL, '', 'T', '2012-02-02 15:31:38', 1, '2014-12-18 10:47:47', 1, 'F'),
(25, 'map4', 'Map4', 'T', '0', 'Crowleyâ€™s suggested grouping of the dialects (Crowley 1978:163) ', 'Crowleyâ€™s suggested grouping of the dialects (Crowley 1978:163)&nbsp;<div> Pronominal forms 1.&nbsp; 1<sup>st</sup> sg ergative, 2.&nbsp; 1<sup>st</sup> sg benefactive, 3. 2<sup>nd</sup>\r\nperson sg absolutive, 4.&nbsp; ergative\r\nsuffix after /y/ (in older orthography)  <br><img src="http://Bundjalung.dalang.com.au/plugin_wiki/attachment/23">  </div>', '|3|', NULL, '', 'T', '2013-04-27 22:27:34', 1, '2014-08-02 08:36:25', 2, 'F'),
(29, 'Sounds', 'Sounds', 'T', 'T', '<p>Sound of letters in Bundjalung</p>', '<p><strong>u</strong> sounds like <strong>u</strong> in <strong>put</strong> or <strong>oo</strong> in <strong>good.</strong></p>\r\n<p><strong>u</strong> sounds like <strong>u</strong> in <strong>put</strong> or <strong>oo</strong> in <strong>good.</strong></p>\r\n<p><strong>Jugi-jugi </strong>(pronounced chooky chooky &ndash; you can guess it was borrowed from English) a chook, a hen</p>\r\n<p>&nbsp;</p>\r\n<p><strong>jali</strong> (jall-ee) tree &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>waybar</strong> fire &nbsp; &nbsp;(why-barr or web-barr)</p>\r\n<p>&nbsp;</p>\r\n<p><strong><img style="margin-right: 100px; margin-left: 100px;" src="../../../images/campfire.png" alt="" width="220" height="128" /></strong></p>\r\n<p><strong>Jugi-jugi jaliyah?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jugi-jugi waybarah!</strong></p>\r\n<p>Is the chook in the tree? The chook is in the fire!</p>\r\n<p><strong>Guybahla mala!</strong></p>\r\n<p>They are roasting it!</p>\r\n<h4><strong>More sounds</strong></h4>\r\n<p>&nbsp;</p>\r\n<p><strong>(Bundjalung bandjalahm)</strong></p>\r\n<p>butterfly</p>\r\n<div><strong><img style="margin-right: 100px; margin-left: 100px;" src="../../../images/butterfly.png" alt="" width="72" height="42" /></strong></div>\r\n<div style="text-align: right;"><strong>Bahbany jalum-nguhrgan.</strong></div>\r\n<div>\r\n<p style="text-align: right;">Granny has fish</p>\r\n<p><img style="float: right;" src="../../../images/Actions/caught_fish.png" alt="" width="100" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Baygal budjarbiny-nguhrgan. </strong> The man has flowers.</p>\r\n<p style="text-align: left;">&nbsp;<img src="../../../images/man_with_flowers.png" alt="" width="46" height="82" /></p>\r\n<p style="text-align: right;"><img src="../../../images/going.png" alt="" width="60" height="75" /></p>\r\n<p style="text-align: right;"><strong>Yan.gahla</strong></p>\r\n<p style="text-align: right;">going&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p><img src="../../../images/vegetables.png" alt="" width="331" height="42" />&nbsp;</p>\r\n<p><strong>nangany (nungany)</strong> vegetable food</p>\r\n<p>&nbsp;<img src="../../../images/look_at_me.png" alt="" width="62" height="67" /></p>\r\n<p><strong>Nyah nganyi!</strong> Look at me!</p>\r\n<p>&nbsp;<img src="../../../images/rat_in_tree.png" alt="" width="159" height="106" /></p>\r\n<p><strong>Gundur jaliyah!</strong> The rat in the tree!</p>\r\n<p><img style="float: right;" src="../../../images/hair.png" alt="" width="77" height="88" /></p>\r\n<p style="text-align: right;"><strong>gundur</strong> hair of head</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<img src="../../../images/man_in_boat.png" alt="" width="107" height="71" /></p>\r\n<p><strong>Dandaygam gandulah nyulangaha. </strong></p>\r\n<p>The old man in his boat.</p>\r\n<p>&nbsp;<img src="../../../images/crow_in_tree.png" alt="" width="163" height="134" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Wagahn jaliyah. </strong></p>\r\n<p>The crow in the tree.</p>\r\n<p><strong>&nbsp;<img src="../../../images/caterpillar.png" alt="" width="115" height="73" /></strong></p>\r\n<p><strong>Yagay! Waringihn jinanggah nganyah!</strong></p>\r\n<p>Yah! There&rsquo;s a caterpillar on my foot!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<strong>&nbsp;</strong></div>', '|14|', NULL, '', 'T', '2013-08-24 22:04:31', 1, '2015-02-05 18:26:00', 1, 'F'),
(46, 'dictionary2', 'Dictionary Part 2', 'T', '0', '', 'Here is the second part\r\n<iframe src= "http://www.bundjalung.dalang.com.au/filedownload/file/Language-EnglishH-Y.pdf"  style="width:718px; height:700px;" frameborder="0"></iframe>', '|2|', NULL, '', 'T', '2014-05-30 19:05:00', 2, '2014-05-30 19:10:23', 2, 'F'),
(44, 'songs', 'Songs', 'T', '0', 'Songs recorded in Bundjalung and Githabul by Margaret Gummow', 'Songs recorded in Bundjalung and Githabul by Margaret Gummow<div><br></div> \r\n<br>\r\n<audio controls>\r\n<source src="http://www.bundjalung.dalang.com.au/filedownload/media/sounds/gummowsongs.mp3" type="audio/mpeg">\r\n</audio>', '|36|', NULL, '', 'T', '2014-05-30 17:10:54', 2, '2014-08-02 12:30:37', 2, 'F'),
(45, 'dictionary', 'Dictionary', 'T', '0', 'Darruyay yilaaming maam-weba Muurrbay-gundi.  Ngawaadu ngiyaanya, yuludarla wajaarr gani.  Ngawaadu jalaarla ngiyambala muugay waarruwaygam; ngiyaanya balmuunambay.  Welcome to the Muurrbay website.  Our language comes from our country.  Language gives us our identity and makes us strong.', 'The Bundjalung Dictionary in two parts\r\n<br>\r\n\r\nThis is part 1, words A-G. Click <a href="http://bundjalung.dalang.com.au/filedownload/file/Language-EnglishH-Y.pdf">here for part 2</a>\r\n<br>\r\n<iframe src= "http://bundjalung.dalang.com.au/filedownload/file/Language-EnglishA-G.pdf"  style="width:1000px; height:700px;" frameborder="0"></iframe>', '|2|', NULL, '', 'T', '2014-05-30 18:56:20', 2, '2015-01-16 12:40:33', 2, 'F'),
(47, 'headshoulders', 'Words to Head Shoulders', 'T', '0', '', '<p>Words to the song Head Shoulders Knees and Toes\r\n</p>\r\n<audio controls>\r\n<source src="http://www.bundjalung.dalang.com.au/filedownload/media/sounds/head%20and%20shoulders.wav"/>\r\n</audio>', '|14|', NULL, '', 'T', '2014-05-30 19:05:45', 2, '2014-08-01 12:18:06', 2, 'F'),
(49, 'usedictionary', 'Use of Dictionary', 'T', '0', '<p class="p1"><span class="s1">Muurrbay plans to conduct workshops around Bundjalung-Yugambeh country to help people use this online dictionary. It is a work in progress so you feedback is important to us.</span></p>', '<p>Explain how to use dictionary here</p>', '|2|', NULL, '', 'T', '2015-01-16 12:46:17', 2, '2015-02-02 13:05:38', 1, 'F'),
(54, 'introduction', 'Introduction', 'T', 'F', '<p>This site was set up to enable people to access the Bundjalung-Yugambeh dictionary. In the future we will be adding more sound files so you can hear how words are pronounced and pictures to illustrate different words. </p><p>Over the years many Bundjalung â€“ Yugambeh  speakers have been recorded by various researchers, and word lists have been collected and written down by many people. All this information has been brought together and complied by Margaret Sharpe into a set of documents that make up a dictionary and finder lists. </p><p>This website is adapted from these documents. We are also adding sound files from recordings of today''s Bundjalung teachers, such as Poppy Harry Walker.</p>\r\n<p>To look a the map to the right, hover your mouse over it</p>', '', '', NULL, '', 'T', '2015-02-05 10:57:22', 2, '2015-02-05 10:57:22', 2, 'F'),
(55, 'written_examples_of_the_language', 'Written examples of the language', 'T', '0', '<p><a href="../../../language/dictionary">/language/dictionary</a></p>', '<p>These sentences are from Wahlubal/Western Bandjalang ( Crowley:1978).</p>\r\n<p>Ngay waymalehla nganyahya nguyaya.<br />I am speaking my own language.</p>\r\n<p><em>Nyarram mala behn gudjahrra</em>.<br />The frilled-neck lizard fell into a hole.</p>\r\n<p><em>Wanah yirrali-ngahyumah</em>.<br />Don&rsquo;t (speak in) English.</p>\r\n<p><em>Mala baygal djehrr</em>.<br />That man is big.</p>\r\n<p><em>Djununu wudja yang giwani</em>.<br />Where have you come from?</p>\r\n<p><em>Maliyu dandaygambu yarbini.</em><em><br /></em>That man sang (a song).</p>\r\n<p><em>Mala bin-gihng birrah waybarra mala waganyngula</em>.<br />Throw that turtle onto the fire, and that catfish too!</p>\r\n<p><em>Yuh ngali yanah buyan gala djahnanah</em>.<br />Let&rsquo;s go later when the wind stops.</p>\r\n<p>&nbsp;</p>\r\n<p>There are a lot of examples in the&nbsp;<a href="../../../language/dictionary">dictionary.</a></p>', '|2|', NULL, '', 'T', '2015-02-05 12:33:05', 1, '2015-02-05 13:03:18', 1, 'F'),
(56, 'history', 'History', 'T', '0', '<p>The site was set up by Muurrbay in 2014-5 to share the Bundjalung-Yugambeh dictionary with funding from ??. The project is still in development.</p>', '', '|1|', NULL, '', 'T', '2015-02-05 12:35:18', 1, '2015-02-05 12:41:39', 1, 'F'),
(57, 'outline_of_the_language', 'Outline of the language', 'T', '0', '', '<ul>\r\n<li>Bundjalung has 4 vowels: i, a, u and e each of which can also be pronounced as a longer vowel. There are 10 consonants: b, d, dj, g, m, n, ng, ny, l, r, w and y.</li>\r\n<li>Nouns take many different suffixes (tag endings) to mark such roles as subject, object, instrument, location, movement towards, possession and to make feminine from masculine nouns. Nouns can also show singular and plural in three classes: masculine, feminine, and neuter or tree nouns.</li>\r\n<li>Verbs have 4 tenses: future, present, and two pasts; various suffixes also show that someone &lsquo;keeps on&rsquo; doing something, or that people are doing something &lsquo;to each other&rsquo; .</li>\r\n<li>Word order is fairly free, although there is a tendency toward Subject &ndash; Object &ndash; Verb word order.</li>\r\n</ul>\r\n<p>&nbsp;</p>', '|2|', NULL, '', 'T', '2015-02-05 12:35:38', 1, '2015-02-05 12:36:17', 1, 'F'),
(58, 'outline_of_resources', 'Outline of resources', 'T', '0', '<p>Various people, including researchers, have been writing down information about the Bandjalung language since the late 1800s. A few Bundjalung dialects have been recorded in some detail, while for others there are limited records, or no record at all. A large collection of audio recordings of Bundjalung speakers, and researchers&rsquo; field notes are held at the Australian Institute of Aboriginal and Torres Strait Islander Studies in Canberra.</p>\r\n<p>&nbsp;</p>', '<p>There are four dialects that have been described in detail:</p>\r\n<ul>\r\n<li>Yugumbeh: Cunningham&rsquo;s 1969 grammar is reliable;</li>\r\n<li>Gidabal: the Geytenbeek&rsquo;s 1971 grammar and word-list;</li>\r\n<li>Wahlubal or Western Bundjalung: Crowley&rsquo;s 1978 grammar and wordlist is the most detailed available;</li>\r\n<li>Casino dialect: Smythe&rsquo;s 1940s description first appeared in Crowley 1978;</li>\r\n<li>Sharpe&rsquo;s description of&nbsp; the &lsquo;Yugambeh-Bundjalung dialect chain&rsquo;.</li>\r\n</ul>\r\n<p>There are brief sketch grammars on several Bundjalung dialects, including:</p>\r\n<ul>\r\n<li>the Minjangbal dialect of Byron Bay, Livingstone (1892),</li>\r\n<li>Biirin dialect of Rappville and the Baryulgil dialect, Crowley (n.d)</li>\r\n<li>Bundjalung dialect of Bungawalbin Creek, Holmer (1971)</li>\r\n<li>over 17 word-lists from various areas, Hargrave (Science of Man:1903).</li>\r\n</ul>', '|2|', NULL, '', 'T', '2015-02-05 12:39:18', 1, '2015-02-05 12:39:44', 1, 'F'),
(59, 'traditional_country', 'Traditional country', 'T', '0', '', '<p>The Bundjalung language was spoken in an area that included the north-east corner of New South Wales and the south-eastern corner of Queensland. This area stretches from Grafton on the Clarence River in the south, to the Logan River in the north and inland as far as the Great Dividing Range at Tenterfield and Warwick. It includes the regional centres of Lismore, Casino, Kyogle, Woodenbong, Byron Bay, Ballina, Coolangatta-Tweed Heads, Murwillumbah, the Gold Coast, Beaudesert and Warwick.</p>\r\n<p>&nbsp;</p>', '|2|3|', NULL, '', 'T', '2015-02-05 12:59:25', 1, '2015-02-05 13:00:48', 1, 'F'),
(60, 'language_background', 'Language background', 'T', '0', '', '<p>Bundjalung (also spelt Bandjalang or Banjalang) belongs to the Pama-Nyungan family of Australia languages. At the time of first contact with Europeans in the mid 1800s, there was up to 20 dialects of Bundjalung. &lsquo;Bundjalung&rsquo; has been used as a general term for the whole language (covering all the different dialects) and also as a term to refer to certain individual dialects. However, each dialect has a specific name of its own. Dialects include: Wahlubal (also known as Western Bandjalang), Yugambeh, Birrihn, the Barryugil dialect, Bandjalang, Wudjebal, Wiyabal, Wuhyabal, Minyangbal, Gidhabal, Galibal and Ngarrahngbal. Many of these names point to some characteristic peculiar to that dialect. For example, Gidhabal means &lsquo;those who say gidha (alright)&rsquo;, while Wiyabal means &lsquo;those who say wiya (you)&rsquo;.&nbsp; It is thought that the term &lsquo;Bandjalung&rsquo; was originally used to describe the dialect spoken around Bangawalbin Creek and that this name was later used to cover all dialects.</p>\r\n<p>Although Bundjalung people slowed the stealing of tribal lands by European settlers, the European invasion had a severe impact on population, settlement and inhabitation of tradition areas, and on cultural practices, including language use. The use of Bundjalung was actively suppressed, and English emerged as a common language. Despite the forces working against Bundjalung, some dialects were still actively and widely used as late as the 1950s.</p>\r\n<p>&nbsp;</p>', '|2|', NULL, '', 'T', '2015-02-05 13:00:00', 1, '2015-02-05 13:00:26', 1, 'F'),
(61, 'people', 'People', 'T', '0', '', '<p>Bundjalung people have been teaching their language and culture in community groups and schools for many years. Years ago, Bundjalung people were multilingual, also speaking the languages of their neighbours. Several Bundjalung speakers were recorded in the1960s and 1970s; along with today&rsquo;s speakers, these recordings form the bedrock for current Bundjalung language revitalisation.</p>', '|1|', NULL, '', 'T', '2015-02-05 13:00:51', 1, '2015-02-05 13:01:29', 1, 'F');
