(1, 49, 'usedictionary', 'Use of Dictionary', 'T', 0, 'Darruyay yilaaming maam-weba Muurrbay-gundi.  Ngawaadu ngiyaanya, yuludarla wajaarr gani.  Ngawaadu jalaarla ngiyambala muugay waarruwaygam; ngiyaanya balmuunambay.  Welcome to the Muurrbay website.  Our language comes from our country.  Language gives us our identity and makes us strong.', 'Explain how to use dictionary here', '|2|', NULL, '', 'T', '2015-01-16 12:46:17', 2, '2015-01-16 12:49:48', 2, 'F'),
(2, 49, 'usedictionary', 'Use of Dictionary', 'T', 0, '<p class="p1"><span class="s1">Muurrbay plans to conduct workshops around Bundjalung-Yugambeh country to help people use this online dictionary. It is a work in progress so you feedback is important to us.</span></p>', '<p>Explain how to use dictionary here</p>', '|2|', NULL, '', 'T', '2015-01-16 12:46:17', 2, '2015-02-02 13:04:12', 1, 'F'),
