(15, 55, 'written_examples_of_the_language', 'Written examples of the language', 'T', 0, '<p><a href="../../../language/dictionary">/language/dictionary</a></p>', '<p>These sentences are from Wahlubal/Western Bandjalang ( Crowley:1978).</p>\r\n<p>Ngay waymalehla nganyahya nguyaya.<br />I am speaking my own language.</p>\r\n<p><em>Nyarram mala behn gudjahrra</em>.<br />The frilled-neck lizard fell into a hole.</p>\r\n<p><em>Wanah yirrali-ngahyumah</em>.<br />Don&rsquo;t (speak in) English.</p>\r\n<p><em>Mala baygal djehrr</em>.<br />That man is big.</p>\r\n<p><em>Djununu wudja yang giwani</em>.<br />Where have you come from?</p>\r\n<p><em>Maliyu dandaygambu yarbini.</em><em><br /></em>That man sang (a song).</p>\r\n<p><em>Mala bin-gihng birrah waybarra mala waganyngula</em>.<br />Throw that turtle onto the fire, and that catfish too!</p>\r\n<p><em>Yuh ngali yanah buyan gala djahnanah</em>.<br />Let&rsquo;s go later when the wind stops.</p>\r\n<p>&nbsp;</p>\r\n<p>There are a lot of examples in the dictionary.</p>', '|2|', NULL, '', 'T', '2015-02-05 12:33:05', 1, '2015-02-05 13:02:41', 1, 'F'),
(16, 29, 'Sounds', 'Sounds', 'T', 0, 'Sound of letters in Bundjalung', '<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt;margin-left:34.9pt;text-indent:36.0pt""=""><strong>u</strong>\r\nsounds like <strong>u</strong> in <strong>put</strong> or <strong>oo</strong> in <strong>good.</strong></p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt";margin-left:70.9pt"=""><strong>jugjug </strong>(pronounced chook chook â€“\r\nyou can guess it was borrowed from English)&nbsp; a chook, a hen</p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt";margin-left:70.9pt"="">&nbsp;<strong>ruwu</strong>&nbsp; (roo-woo)&nbsp; tree &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>wubu</strong>&nbsp; fire&nbsp;&nbsp;(wooboo\r\nor ooboo)</p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt";margin-left:70.9pt"="">&nbsp;(At the\r\nbeginnings of words, <strong>wu</strong> can sound\r\nlike <strong>u</strong>.)</p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt;margin-left:70.9pt;text-align:center"="">&nbsp;</p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt;margin-left:70.9pt;text-align:center"=""><img width="271" height="254" src="/image/campfire.png" shapes="_x0000_i1025"></p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt;margin-left:70.9pt;text-align:center"=""><strong>Jugjug ruwir?    Jugjug wubir!</strong></p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt;margin-left:70.9pt;text-align:center"="">Is the chook in the\r\ntree?&nbsp; The chook is in the fire!</p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt;margin-left:70.9pt;text-align:center"=""><strong>Burda-yireni nda jugjug!</strong></p>\r\n<p style="" margin-top:0cm;margin-right:35.1pt;margin-bottom:.0001pt;margin-left:70.9pt;text-align:center"="">They are cooking the chook!</p>\r\n<div><strong><br></strong></div>', '|14|', NULL, '', 'T', '2013-08-24 22:04:31', 1, '2014-08-02 13:05:04', 2, 'F'),
(17, 29, 'Sounds', 'Sounds', 'T', 0, '<p>Sound of letters in Bundjalung</p>', '<p><strong>u</strong> sounds like <strong>u</strong> in <strong>put</strong> or <strong>oo</strong> in <strong>good.</strong></p>\r\n<p><strong>jugjug </strong>(pronounced chook chook &ndash; you can guess it was borrowed from English)&nbsp; a chook, a hen</p>\r\n<p>&nbsp;<strong>ruwu</strong>&nbsp; (roo-woo)&nbsp; tree &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>wubu</strong>&nbsp; fire&nbsp;&nbsp;(wooboo or ooboo)</p>\r\n<p>&nbsp;(At the beginnings of words, <strong>wu</strong> can sound like <strong>u</strong>.)</p>\r\n<p>&nbsp;</p>\r\n<p><img src="../../../uploads/image/campfire.png" alt="" width="271" height="254" /></p>\r\n<p><strong>Jugjug ruwir? Jugjug wubir!</strong></p>\r\n<p>Is the chook in the tree?&nbsp; The chook is in the fire!</p>\r\n<p><strong>Burda-yireni nda jugjug!</strong></p>\r\n<p>They are cooking the chook!</p>\r\n<div><strong>&nbsp;</strong></div>', '|14|', NULL, '', 'T', '2013-08-24 22:04:31', 1, '2015-02-05 13:33:44', 1, 'F'),
(18, 29, 'Sounds', 'Sounds', 'T', 0, '<p>Sound of letters in Bundjalung</p>', '<p><strong>u</strong> sounds like <strong>u</strong> in <strong>put</strong> or <strong>oo</strong> in <strong>good.</strong></p>\r\n<p><strong>jugjug </strong>(pronounced chook chook &ndash; you can guess it was borrowed from English)&nbsp; a chook, a hen</p>\r\n<p>&nbsp;<strong>ruwu</strong>&nbsp; (roo-woo)&nbsp; tree &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>wubu</strong>&nbsp; fire&nbsp;&nbsp;(wooboo or ooboo)</p>\r\n<p>&nbsp;(At the beginnings of words, <strong>wu</strong> can sound like <strong>u</strong>.)</p>\r\n<p>&nbsp;</p>\r\n<p><img src="../../uploads/image/campfire.png" alt="" width="271" height="254" /></p>\r\n<p><strong>Jugjug ruwir? Jugjug wubir!</strong></p>\r\n<p>Is the chook in the tree?&nbsp; The chook is in the fire!</p>\r\n<p><strong>Burda-yireni nda jugjug!</strong></p>\r\n<p>They are cooking the chook!</p>\r\n<div><strong>&nbsp;</strong></div>', '|14|', NULL, '', 'T', '2013-08-24 22:04:31', 1, '2015-02-05 13:50:53', 1, 'F'),
(19, 29, 'Sounds', 'Sounds', 'T', 0, '<p>Sound of letters in Bundjalung</p>', '<p><strong>u</strong> sounds like <strong>u</strong> in <strong>put</strong> or <strong>oo</strong> in <strong>good.</strong></p>\r\n<p><strong>jugjug </strong>(pronounced chook chook &ndash; you can guess it was borrowed from English)&nbsp; a chook, a hen</p>\r\n<p>&nbsp;<strong>ruwu</strong>&nbsp; (roo-woo)&nbsp; tree &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>wubu</strong>&nbsp; fire&nbsp;&nbsp;(wooboo or ooboo)</p>\r\n<p>&nbsp;(At the beginnings of words, <strong>wu</strong> can sound like <strong>u</strong>.)</p>\r\n<p>&nbsp;</p>\r\n<p><img src="../../uploads/image/campfire.png" alt="" width="271" height="254" /></p>\r\n<p><strong>Jugjug ruwir? Jugjug wubir!</strong></p>\r\n<p>Is the chook in the tree?&nbsp; The chook is in the fire!</p>\r\n<p><strong>Burda-yireni nda jugjug!</strong></p>\r\n<p>They are cooking the chook!</p>\r\n<div><strong>&nbsp;</strong></div>', '|14|', NULL, '', 'T', '2013-08-24 22:04:31', 1, '2015-02-05 13:51:50', 1, 'F'),
