(22, 29, 'Sounds', 'Sounds', 'T', 0, '<p>Sound of letters in Bundjalung</p>', '<p><strong>u</strong> sounds like <strong>u</strong> in <strong>put</strong> or <strong>oo</strong> in <strong>good.</strong></p>\r\n<p><strong>u</strong> sounds like <strong>u</strong> in <strong>put</strong> or <strong>oo</strong> in <strong>good.</strong></p>\r\n<p><strong>Jugi-jugi </strong>(pronounced chooky chooky &ndash; you can guess it was borrowed from English) a chook, a hen</p>\r\n<p>&nbsp;</p>\r\n<p><strong>jali</strong> (jall-ee) tree &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>waybar</strong> fire &nbsp; &nbsp;(why-barr or web-barr)</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://bundjalung.dalang.com.au/image/campfire.png" alt="" width="271" height="254" /></p>\r\n<p><strong>Jugi-jugi jaliyah?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jugi-jugi waybarah!</strong></p>\r\n<p>Is the chook in the tree? The chook is in the fire!</p>\r\n<p><strong>Guybahla mala!</strong></p>\r\n<p>They are roasting it!</p>\r\n<h4><strong>More sounds</strong></h4>\r\n<p>&nbsp;</p>\r\n<p><strong>(Bundjalung bandjalahm)</strong></p>\r\n<p>butterfly</p>\r\n<div><strong><img style="margin-right: 100px; margin-left: 100px;" src="http://bundjalung.dalang.com.au/image/butterfly.png" alt="" width="72" height="42" /></strong></div>\r\n<div style="text-align: right;"><strong>Bahbany jalum-nguhrgan.</strong></div>\r\n<div>\r\n<p style="text-align: right;">Granny has fish</p>\r\n<p><img style="float: right;" src="http://bundjalung.dalang.com.au/image/Actions/caught_fish.png" alt="" width="100" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Baygal budjarbiny-nguhrgan. </strong> The man has flowers.</p>\r\n<p>&nbsp;<img src="man_with_lowers.png" alt="" /></p>\r\n<p><strong>Yan.gahla</strong></p>\r\n<p>going&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>nangany (nungany)</strong> vegetable food</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Nyah nganyi!</strong> Look at me!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Gundur jaliyah!</strong> The rat in the tree!</p>\r\n<p><strong>gundur</strong> hair of head</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Dandaygam gandulah nyulangaha. </strong></p>\r\n<p>The old man in his boat.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Wagahn jaliyah. </strong></p>\r\n<p>The crow in the tree.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Yagay! Waringihn jinanggah nganyah!</strong></p>\r\n<p>Yah! There&rsquo;s a caterpillar on my foot!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<strong>&nbsp;</strong></div>', '|14|', NULL, '', 'T', '2013-08-24 22:04:31', 1, '2015-02-05 14:16:02', 1, 'F'),
